import SignUpPage from './components/SignUpPage';


function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/signup" component={SignUpPage} />
        <Route path="/login" component={Login} />
      </Switch>
    </Router>
  );
}

export default App;
